]

function NestedMapping() {
  return (
    <div className='container'>
           
          {User.map((user)=>{
            const {title,desc} =user;
            return(
                <article>
                  <h3>Title:{title}</h3>
                  <p>description:{desc}</p>
                  {user.country.map((country)=><div>
                    <p>Country:{country.name}</p>
                    <p>population:{country.population}</p>
                    </div>
                   
                  )}
                </article>
            )
          })}

    </div>
  )
}

export default NestedMapping
